import { useState } from 'react'

const ListRender = () => {

    const [list] = useState(["Diego", "Matheus", "Juliana", "Sergio", "Aline", "Diego"]);
    
    return (
    <div>
        <ul>
            {list.map((item) => (
                <li key={item}>{item}</li>
            ))}
        </ul>
    </div>
    )
}

export default ListRender
